import '../../App.css';
const Main = () => {
    return (
        <div className='row'>
            <div className="col-12 col-sm-12 col-lg-12 col-xl-12 col-md-12" id="main">
                <div id='landingContent'>
                    <div className='row'>
                        <div className='col-9 col-sm-9 col-md-9 col-lg-9 col-xl-9'>
                            <h1>Send One Time Password via SMS</h1>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}
export default Main;
